import React from "react";
import "../styles/ErrorPage.scss";

const NotFound = () => {
  const handleBackToDashboard = () => {
    // Navigate or do something else
    // e.g., window.location.href = "/dashboard";
    alert("Redirecting to dashboard...");
  };

  return (
    <div className="notfound-container">
      <div className="notfound-card">
        {/* This could be an <img> or any suitable illustration */}
        <div className="notfound-image">
          {/* 
            You could import an image, or reference an external URL.
            Example: <img src="/path/to/404.png" alt="404 Error" />
          */}
          <img
            src="https://via.placeholder.com/300x200?text=404+Illustration"
            alt="404 Illustration"
          />
        </div>


        <h2>Looks like you’ve got lost…</h2>

        {/* Button */}
        <button onClick={handleBackToDashboard}>Back to Dashboard</button>
      </div>
    </div>
  );
};

export default NotFound;
